class Moto {
    constructor(nome) {
        this.nome = nome;
        this.velocidade = 0;
    }
    buzinar() {
        console.log('Tooot');
    }
    acelerar(delta) {
        this.velocidade += delta;
    }
}
const moto = new Moto('Ducati');
moto.buzinar();
console.log(moto.velocidade);
moto.acelerar(30);
console.log(moto.velocidade);
// Exercício 2 - Herança
class objeto2D {
    constructor(base = 0, altura = 0) {
        this.base = base;
        this.altura = altura;
    }
}
class retangulo extends objeto2D {
    constructor(base, altura) {
        super(base, altura);
    }
    area() {
        return this.base * this.altura;
    }
}
let calculoBaseAltura = new retangulo(5, 4);
console.log(`Cálculo base altura: ${calculoBaseAltura.area()}`);
